import React from 'react';
import Slider from '../component/global/glide-slider';
const slides = [
  {
    image: 'image1.jpg',
    heading: 'Heading 1',
    paragraph: 'Paragraph 1',
    circleImage: 'circleImage1.jpg',
    circleText: 'Circle Text 1'
  },
  {
    image: 'image2.jpg',
    heading: 'Heading 2',
    paragraph: 'Paragraph 2',
    circleImage: 'circleImage2.jpg',
    circleText: 'Circle Text 2'
  },
  {
    image: 'image3.jpg',
    heading: 'Heading 3',
    paragraph: 'Paragraph 3',
    circleImage: 'circleImage3.jpg',
    circleText: 'Circle Text 3'
  }
];

const App = () => {
  return (
    <div>
      <Slider slides={slides} />
    </div>
  );
};

export default App;
